import React, { useEffect, useState } from "react";

function Tick() {
  var time = new Date().toLocaleTimeString();
  useEffect(() => {
    const timer = setTimeout(() => {
      time = new Date().toLocaleTimeString();
    }, 1000);
    return () => clearTimeout(timer);
  }, []);

  return (element = (
    <div>
      <h1>Hello, world!</h1>
      <h2>It is {time}.</h2>
    </div>
  ));
}

export default Tick;
